package com.abc;

public class SecondAssnDay1 {

	public static void main(String[] args) {
		
		String input="";
		int l=input.length();
		int n=l/2;
		int sum=0;
		
		
		for(int i=0;i<l;i++) {
			
			if((i+n)<=l-1) {
			
				if(input.charAt(i)==input.charAt(i+n)) {
					sum=sum+Integer.parseInt(String.valueOf(input.charAt(i)));
				}
			
			}
			
			else if((i+n)==l) {
				
				if(input.charAt(i)==input.charAt(0)) {
					sum=sum+Integer.parseInt(String.valueOf(input.charAt(i)));
				}
				
			}
			
			else if((i+n)>l) {
				
				if(input.charAt(i)==input.charAt((i+n)-l)) {
					sum=sum+Integer.parseInt(String.valueOf(input.charAt(i)));
				}
				
			}
		}
		
		System.out.println(sum);
		
	}

}